import React from 'react';
import styled from 'styled-components';


const FooterMenu = (props) => {
  return (
    <section className="footerMenu">
        <a className="menuItem desktop" href="terms-and-conditions.html">Terms &
            Conditions</a>
        <a className="menuItem desktop" href="privacy-policy.html">Privacy</a>
        <a className="menuItem desktop" target="_blank" rel="noopener noreferrer" href="https://dexwallet.freshdesk.com/">Support</a>
        <a className="menuItem desktop" href="mailto:founders@dexlab.io">Business Inquiries</a>
    </section>

      );
}

export default FooterMenu;
